About the artist:
Rebecca is a Doncaster born fashion illustrator based in Leeds. After graduating from Leeds College of Art Rebecca now works freelance specialising in fashion, beauty and product illustration with a portfolio also including realist portraiture and fantasy art.

In addition to project briefs, Rebecca also works live as an events illustrator creating real-time artwork as mementos for guests, hosting workshop tutorials and live art demos.

Working both traditionally and digitally, Rebecca's work spans from striking and simple line work to fantastically bold & bright colour renderings.

Rebecca has worked with various international fashion and beauty brands including Dior, Acqua di Parma and L'Oreal Paris, and has been published in leading international publications including Imagine FX and Tatler.
